import React, { useState } from 'react';
//import axios from 'axios'; // If you're using axios

const OAuth2Data = require('../credentials1.json');
const client_ID = OAuth2Data.web.client_id;

function HomePage() {

  const [value, setValue] = useState('');

  const handleChange = (event) => {
    setValue(event.target.value);
  };

  const handleSubmit = () => {
    const dataToSend = { textValue: value };
    axios.post('/api/submit-text', dataToSend)
      .then(response => {
        console.log(response.data); // Handle the response from the server here
      })
      .catch(error => {
        console.error('There was an error!', error);
      });
  };

  return (
    <div id="text-input">
      <input type="text" value={value} onChange={handleChange} />
      <p>You typed: {value}</p>
      <button onClick={handleSubmit}>Submit</button> {/* Add a button to trigger the submission */}
    </div>
  );
}

export default HomePage;
